	public static String cargoQtyCheckFromNUmeric(String jsonString){
		try {
			JSONObject finaljsobj=new JSONObject();
			// jsonString=MethodJsonOnlyInsert.jsonInpput();
			
			boolean jsoncheckCargoQty=SaveReportDataClass.isJSONValid(jsonString);
			if(jsoncheckCargoQty){
				JSONObject objectjson = new JSONObject(jsonString);
				Iterator<String> keys = objectjson.keys();
				while (keys.hasNext()) {
					
					String key = keys.next();
					
					Object keyValue = objectjson.get(key);
					if (keyValue instanceof JSONObject) {
						JSONObject tabledataJsonObj=null;
						tabledataJsonObj = (JSONObject)keyValue;
						
						if(tabledataJsonObj.has("table_data")){
							JSONArray allReportJsonArray=tabledataJsonObj.getJSONArray("table_data");
							//System.out.println(allReportJsonArray);
							if(allReportJsonArray.length()>0){
								// check report and vesselname mandatory
								// check two json first 
								// if it is match then apply on same position key
								JSONObject f=new JSONObject();
								int j=0;
								for(int i=0;i<allReportJsonArray.length();i++){
									JSONObject allReportJsonArrayInsideJSonobject=allReportJsonArray.getJSONObject(i);
									j++;
									String ReportTypeString="";
									String vesselName="";
									boolean spotFound=false;
									
									if(allReportJsonArrayInsideJSonobject.has("ReportType")){
										ReportTypeString=allReportJsonArrayInsideJSonobject.getString("ReportType");
										if(ReportTypeString.equals("Spot")){
											 spotFound=true;
										}
									}if(allReportJsonArrayInsideJSonobject.has("VesselName")){
										vesselName=ReportTypeString=allReportJsonArrayInsideJSonobject.getString("VesselName");
									}
									
									if( spotFound ){
									if( (!GmailMethods.isNullString(ReportTypeString)) && (!GmailMethods.isNullString(vesselName)) ){
										
										Iterator<String>itr=allReportJsonArrayInsideJSonobject.keys();
										int cargoQtyCount=0;
										String keysDynamic="";
										while(itr.hasNext()){
											  keysDynamic= itr.next();
											  String value=allReportJsonArrayInsideJSonobject.getString(keysDynamic);
											 boolean numeric = true;
											  
										        try {
										            Integer num = Integer.parseInt(value);
										            
										        } catch (NumberFormatException e) {
										            numeric = false;
										        }
											  
										        if(numeric){
										        	//System.out.println("numeric_value:: "+value);
										        	//System.out.println("numeric_key:: "+keysDynamic);
										        	f.put(keysDynamic, "CargoQty");
										        	cargoQtyCount++;
										        }
										        
										} // while check numeric 
										
										
										
										if(cargoQtyCount<=1){
                                             	
											Iterator<String>itrf=f.keys();
											String data="";
											while(itrf.hasNext()){
												 data=itrf.next();
												if(f.has(data)){
												  String dataValue= f.getString(data);
												  if(dataValue.equals("CargoQty")){
													  if(allReportJsonArrayInsideJSonobject.has(data)){
														  String qty=allReportJsonArrayInsideJSonobject.getString(data);
														  allReportJsonArrayInsideJSonobject.put("CargoQty", qty);
				                                     	   allReportJsonArrayInsideJSonobject.remove(data);
													  }
													  
												  }
												}
											}
											
										} // count check
										
									} // null check both
									}// report check 
									
								} // for loop close
								
								
							}
							if(allReportJsonArray.length()>0){
							tabledataJsonObj.put("table_data", allReportJsonArray);
							finaljsobj.put(key, tabledataJsonObj);
							jsonString= finaljsobj.toString();
							}
						}
					}
					
				} // while close dyanamic main keys tablewise
				
				
			}
			
			
		} catch (Exception e) {
//			e.printStackTrace();
			System.out.println(e.getMessage());
		}
		return jsonString;
	}
	
